<div class="container">
	<div class="row">
		<div class="col-sm">
			<h4>Sem acordo, PLO 03/2014 ficou para 2015</h4>
		</div>
		<div class="col-sm">
			<!-- TEXTO_PUPLICADO_POR -->
		</div>
		<div class="col-sm">
			<!-- TEXTO_DATA_PUPLICACAO -->
		</div>
	</div>
</div>
<div class="container pb-5 mb-5">
	<div class="row">
		<div class="col-sm">
			<div><div style="text-align: left;"><span style="line-height: 1.2;">A firme atuação da </span><b style="line-height: 1.2;">APROFEM </b><span style="line-height: 1.2;">e de outras Entidades representativas, ligadas aos Profissionais do Nível Superior e da Saúde, a despeito da aprovação dos PLs 312/2014 e 507/2014, foi decisiva para que não se fechasse acordo, na Câmara, para a aprovação da Emenda à Lei Orgânica do Município, autorizando a remuneração por subsídio e alterando as regras para concessão dos quinquênios e sexta-parte.</span></div><div style="text-align: left;"><br></div></div><div style="text-align: left;">Sem a aprovação do PLO 03/2014, o Prefeito ainda terá problemas para sancionar as leis, decorrentes dos projetos aprovados.</div><div style="text-align: left;"><br></div><div style="text-align: left;">Isso não significa, porém, que já podemos nos considerar completamente vitoriosos. Sabemos que o tema voltará à discussão já no início do ano legislativo (fevereiro/2015), ocasião em que o Governo fará pressão total sobre os Vereadores, para a aprovação das mudanças necessárias à pretensão de implementar a remuneração por subsídios, ao menos para as carreiras envolvidas nos dois projetos. Estamos, sim, num período de trégua, mercê do recesso parlamentar, iniciado no dia 19/12, e que se estenderá até 02/02/2015. </div><div style="text-align: left;"><br></div><div style="text-align: left;"><b>Aproveitemos, portanto, para descansar, sabendo que o embate será retomado em breve.</b></div><div style="text-align: left;"><br></div><div><div style="text-align: left;"><span style="line-height: 1.2;">A Câmara Municipal aprovou, no dia 17/12, em Sessão Extraordinária, dois dos Projetos de Lei do Executivo, que tratam da introdução da remuneração por subsídios: o PL 312/2014 para o Pessoal do Nível Superior e o PL 507/2014 para os Profissionais da Saúde, ambos na forma de substitutivos.</span></div><div style="text-align: left;"><br></div></div><div><div style="text-align: left;"><span style="line-height: 1.2;">Entretanto, não foi possível fechar acordo para colocar em  votação o PLO 03/2014, que altera a Lei Orgânica do Município, para viabilizar a sanção, pelo Prefeito, das respectivas leis. Essa discussão, segundo anunciado durante a sessão plenária, ficará para o início do próximo ano, após o recesso parlamentar, que se estende até o final de janeiro/2015.</span></div><div style="text-align: left;"><br></div></div><div style="text-align: left;">A <b>APROFEM </b>permanecerá mobilizada, pois somente a pressão dos servidores municipais será capaz de impedir a aprovação definitiva da remuneração por subsídios. </div><div style="text-align: left;"><br></div><div style="text-align: left;"><span style="line-height: 1.2;">No dia 16/12, nas Sessões Extraordinárias realizadas desde as 10 horas da manhã até as 19 horas, não ocorreu a votação de nenhum dos projetos de interesse do governo, que envolvem os servidores do município.</span><br></div><div><div style="text-align: left;"><br></div><div style="text-align: left;"><span style="line-height: 1.2;">Assim sendo, outras nove Sessões Extraordinárias foram convocadas para o dia 17/12, a partir das 11 horas, com pauta publicada no Diário Oficial do Município, de mesma data, onde constam como primeiros itens, o PL 312/2014 que reestrutura as carreiras de Nível Universitário, o PL 507/2014, que reestrutura os Quadros da Saúde e o PLO 03/2014, que altera a Lei Orgânica do Município , além de  mais de uma centena de outros projetos.</span></div></div><div><div style="text-align: left;"><br></div><div style="text-align: left;"><span style="line-height: 1.2;">Caso não seja possível votar os projetos do Executivo, há, ainda, a convocação de outras duas sessões convocadas para as 0h05  do dia 18/12.</span></div></div><div style="text-align: left;"><br></div><div><div style="text-align: left;"><span style="line-height: 1.2;">É muito fácil perceber que se tratam de estratégias para desmobilizar os servidores que, a despeito do cansaço, continuam frequentando as galerias, manifestando seu descontentamento com as propostas apresentadas./Como resultado de tanta pressão, já foram publicados no DOC de 17/12, PLs substitutivos ao PL 312 e ao PL 507, apresentados por vereadores, após exaustivas negociações com os representantes das categorias envolvidas.</span></div><div style="text-align: left;"><br></div></div><div><div style="text-align: left;"><span style="line-height: 1.2;">Para que possam ser apreciados e votados, porém, deverão passar primeiro pelas Comissões de Constituição, Justiça e Legislação Participativa, de Orçamento e Finanças e de Administração Pública, o que, provavelmente, será feito através do chamado "Congresso de Comissões", que poderá ocorrer no mesmo plenário, mediante suspensão dos trabalhos da sessão que estiver em andamento.</span></div><div style="text-align: left;"><br></div></div><div style="text-align: left;">Portanto, é cada vez mais importante manter as galerias lotadas de servidores que não aceitam as propostas do governo, para tentar convencer os vereadores a rejeitá-las ou, no mínimo, melhorá-las, evitando danos maiores às carreiras dos servidores.</div><div style="text-align: left;"><br></div><div style="text-align: left;"><b>Compareça</b>! </div><div style="text-align: left;"><br></div><div style="text-align: left;">Em Sessão Extraordinária, realizada na manhã do dia 15/12/2014, a Câmara Municipal de São Paulo elegeu sua Mesa Diretora para 2015, uma disputa que mobiliza a todos os Vereadores, propiciando um sem-número de acordos políticos, sempre guiada pela correlação de forças políticas.</div><div style="text-align: left;"><br></div><div style="text-align: left;">Na sequência, foram canceladas as Sessões Extraordinárias previstas para a mesma tarde, passando a vigorar a convocação para outras,  a partir das 10h do dia 16/12, quando deverão ser votados os Projetos do Executivo, em especial os que tratam da remuneração por subsídio: PLO 03/2014, que altera a lei Orgânica, em primeira votação (necessita votos favoráveis de 37 Vereadores), o PL 312/2014 para o Quadro do Nível Superior e PL 507/2014 para o Quadro dos Profissionais da Saúde, ambos em segunda e definitiva votação (necessitam de votos favoráveis da maioria absoluta dos Vereadores).</div><div style="text-align: left;"><br></div><div style="text-align: left;">Portanto, mais uma vez, a <b>APROFEM</b> conclama a todos para que compareçam à Câmara para defender os direitos dos servidores, ora ameaçados por essas propostas do Governo.</div><div style="text-align: left;"><br></div><div style="text-align: left;"><b>Faça sua parte! Faça a diferença!</b></div><div style="text-align: left;"><b><br></b></div><div style="text-align: left;"><b><br></b></div><div style="text-align: left;"><div style="text-align: left;">Na noite de 11/12, por volta das 21h30, na Câmara Municipal, foi aprovado, em primeira votação, o PL 312/2014, criando a remuneração por subsídio para os integrantes das carreiras do Nível Superior.</div><div style="text-align: left;">O projeto recebeu 28 votos favoráveis contra apenas 4 contrários. Evidentemente, os que foram favoráveis compõem a base do governo na Câmara, e os contrários foram os da oposição.</div><div style="text-align: left;">Com um quorum baixo, composto de apenas 32, dos 55 vereadores, o presidente não teria condições de aprovar o PLO 03/2014, que altera a Lei Orgânica do Município, pois são necessários, pelo menos, 37 votos favoráveis. Por essa razão, encerrou a Sessão Extraordinária, mas convocou outras quatro para a segunda-feira, dia 15/12, com início às 11 horas. Foi convocada, também, mais uma Sessão Extraordinária para 0h05 do dia 16, ou seja, para a madrugada da terça-feira.</div><div style="text-align: left;">Como se percebe facilmente, são manobras para tentar desmobilizar os servidores que têm resistido, incansavelmente, comparecendo e permanecendo por horas a fio lotando as galerias da Câmara, peregrinando de gabinete em gabinete, buscando convencer os Srs. Vereadores, das consequências negativas que advirão da aprovação dessas matérias que introduzem a remuneração por subsídio.</div><div style="text-align: left;">A <b>APROFEM</b> tem estado presente e mostra-se atuante nessa luta pela manutenção dos direitos dos servidores municipais, mas alerta: somente a presença expressiva de interessados será capaz de reverter a situação na Câmara, que se mostra, majoritariamente, inclinada a acatar a vontade do Executivo.</div><div style="text-align: left;"><b style="line-height: 1.2;"><br></b></div><div style="text-align: left;"><b style="line-height: 1.2;">Todos à Câmara!</b><br></div><div style="text-align: left;"><b style="line-height: 1.2;"><br></b></div><div style="text-align: left;"><b style="line-height: 1.2;"><br></b></div><div style="text-align: justify;"><div style="text-align: left;">Em função da pressão exercida tanto por entidades contrárias, quanto pelas favoráveis (basicamente as da Saúde) à aprovação dos Projetos que tramitam na Câmara, não houve acordo para a votação prevista para 09/12.</div><div style="text-align: left;">Desta forma, no dia 10/12, quarta-feira, temos que voltar à Câmara, tanto para acompanhar as reuniões das diversas Comissões que vão analisar as propostas, quanto para buscar o diálogo com o maior número possível de vereadores, antes do início das sessões plenárias e, em seguida,  lotar a galeria do Plenário 1º de Maio.</div><div style="text-align: left;">O trabalho é tão desgastante quanto necessário, se quisermos preservar os direitos (conquistados pelos servidores em longos e difíceis embates), ora ameaçados pelos projetos do Executivo.</div><div style="text-align: left;">Infelizmente, até aqui, o comparecimento dos Profissionais de Educação tem sido pequeno, a despeito de todo o esforço que a <b>APROFEM</b> vem fazendo no sentido de esclarecer a importância da participação. Todos sabem que, se os educadores efetivamente  mobilizarem-se, nada será aprovado, pelo menos, não da maneira perversa que está proposta<b>.</b></div><div style="text-align: left; font-weight: bold;"><br></div><div style="text-align: left; font-weight: bold;">Faça sua parte! Compareça!</div><div style="text-align: left; font-weight: bold;"><br></div><div style="text-align: left; font-weight: bold;"><br></div><div><div style="text-align: left;">A movimentação na Câmara Municipal continua intensa. Representantes de Entidades contrárias ao subsídio têm conversado com vereadores e seus assessores, buscando construir substitutivos que melhor contemplem não apenas as posições dos servidores diretamente envolvidos nos Projetos de Lei que tramitam na casa, como também os interesses do conjunto dos servidores municipais, ora seriamente ameaçados pela Proposta de Emenda à Lei Orgânica do Município,  PLO 03/2014.</div><div style="text-align: left;">Embora continue sendo impossível afirmar, com exatidão, quando ocorrerão as votações, a <b>APROFEM</b> continua chamando seus filiados para comparecerem à Câmara, usando camisetas pretas, todas as terças, quartas e quintas-feiras, a partir das 14 horas, num esforço para pressionar os vereadores a ouvir nosso clamor e rejeitar as propostas do Governo, que não negocia com as entidades representativas e intenta fazer passar seus projetos, a despeito dos nossos argumentos em contrário.</div><div style="text-align: left;">No próximo dia 9/12 há intenção da base do governo de aprovar, já em segunda e última votação,  o PL 507/2014, que trata dos Profissioanis da Saúde (efetivando, sem concurso, cerca de vinte mil celetistas), além de tentar votar em primeira, o  PLO 03/2014 que altera a Lei Orgânica do Município, introduzindo a remuneração por subsídio e alterando critérios do quinquênio e da sexta-parte. É, também, possível que tentem votar o PL311/2014 e o 312/2014.</div><div style="text-align: left;">Nos dias subsequentes, caso não consigam aprovar seus projetos no dia 09/12, tentarão fazê-lo nos dias 10 e 11/12. Na impossibilidade, deixarão para a semana seguinte. E assim sucessivamente até o recesso parlamentar, previsto para 23/12, no máximo.</div><div style="text-align: left;">Se  houver o comparecimento expressivo de servidores contrários a essas propostas, os vereadores tenderão a rejeitar os PLs. Caso os favoráveis sejam maioria, a correlação de forças ficará desequilibrada e a tendência será a de termos resultados desastrosos para o serviço público.</div><div style="text-align: left;"><b><br></b></div><div style="text-align: left;"><b>Compareça! Chame seus colegas! Precisamos fazer a diferença agora!</b></div></div><div style="text-align: left; font-weight: bold;"><br></div><div style="text-align: left; font-weight: bold;"><br></div><div><div style="text-align: left;">Ao que tudo indica, por falta de acordo entre vereadores, especialmente os da base aliada ao governo, as discussões e votações dos projetos que afetam os servidores municipais, previstas para o dia 04/12,  foram suspensas porque não havia quórum.</div><div style="text-align: left;">A estratégia dos vereadores que votam favoravelmente aos Projetos do Executivo, quando não têm certeza do apoio necessário, é a de não comparecer, ou de ausentar-se das Sessões  Plenárias, impedindo, assim, a realização das votações.</div><div style="text-align: left;">O mesmo ocorreu com a anunciada reunião extraordinária das comissões que deveriam apreciar o PLO 03/2014, o PL 311/0214 e o PL 312/2014, prevista para as 19 horas do dia 04/12: compareceram os vereadores oposicionistas e alguns da base governista, mas em número insuficiente para a instalação da reunião.</div><div style="text-align: left;">Um fato chamava a atenção. Nesse dia, também não apareceram  na Câmara, os servidores e as Entidades que apoiam os PLs sobre subsídios e que usam camisetas brancas para sinalizar essa posição. Era possível observar apenas a presença de muitos servidores e suas Entidades Representativas, ostentando suas faixas alusivas à rejeição ao subsídio, todos vestindo camisetas pretas, que são já identificadas como símbolo da luta contra essa forma de remuneração.</div><div style="text-align: left;">Isto pode indicar que o primeiro grupo (os de branco), recebeu previamente a informação de que não haveria votações e, portanto, a mobilização não seria necessária.</div><div style="text-align: left;">A <b>APROFEM</b>, Entidade independente e apartidária, que defende os interesses dos servidores, não esmorecerá nessa campanha, que se assemelha a um jogo de cartas marcadas.</div><div style="text-align: left;">Não temos como assegurar quando os Projetos serão realmente votados, mas temos certeza de que somente a presença constante dos servidores, usando camisetas pretas, na Câmara Municipal, conscientes da ameaça que paira sobre todos, poderá, efetivamente, convencer, se não todos, pelo menos a maioria dos vereadores, a rejeitar essas propostas.</div><div style="text-align: left;">As Sessões Ordinárias são previstas para todas as terças, quartas e quintas-feiras, a partir das 15 horas. Além disso, por estarmos no final do ano e por haver muitos projetos para serem votados (inclusive o orçamento para 2015), certamente serão convocadas Sessões Extraordinárias,  geralmente na sequência das Ordinárias, nas quais esses projetos (para os quais há solicitação  do Prefeito para que sejam votados em  " regime de urgência") poderão ser votados.</div><div style="text-align: left;">Os representantes sindicais da <b>APROFEM</b>, em Reunião realizada em 25/11/2014, foram orientados a divulgar essas informações a seus pares e organizar o comparecimento de todos, pelo  menos em sistema de rodízio, num esforço para garantir a representatividade junto à Câmara.</div><div style="text-align: left; font-weight: bold;"><br></div><div style="text-align: left; font-weight: bold;"><span style="line-height: 1.2;">Faça sua parte!      Compareça!      Chame seus colegas!</span></div></div><div style="text-align: left; font-weight: bold;"><span style="line-height: 1.2;"><br></span></div><div style="text-align: center; font-weight: bold;"><img src="data:image/jpeg;base64,
		</div>
